import React from "react";
import { SliderData } from "./SliderData";

function ImageSlider() {
  return (
    <>
      {SliderData.map((slide, idx) => {
        return <img src={slide.image} alt="test" />;
      })}
    </>
  );
}

export default ImageSlider;
